.top{width:750px;margin:auto;padding:0 15px;background:#fff
}
.top__title{color:salmon;text-align:center;padding:15px 0;border-bottom:1px dashed #eee
}
.tabs-component-tabs{display:-webkit-box;display:-ms-flexbox;display:flex;border-bottom:1px solid #eee;padding:0;margin-bottom:0
}
.tabs-component-tabs li{width:50%;list-style:none;padding:15px 0;text-align:center
}
.tabs-component-tabs li a{display:block;text-decoration:none;color:#111
}
.tabs-component-tabs li.is-active a{color:#41b883
}
.items{padding:0;margin:0;display:block
}
.items__item{-webkit-box-sizing:border-box;box-sizing:border-box;width:100%;list-style:none;padding:10px;border-bottom:1px dashed #eee
}
.items__item a{-webkit-box-sizing:border-box;box-sizing:border-box;display:-webkit-box;display:-ms-flexbox;display:flex;text-decoration:none;color:#333;height:100px
}
.items__item a span{display:block;height:100px;line-height:100px;width:100px;text-align:center;font-size:30px
}
.items__item--desc{-webkit-box-flex:1;-ms-flex:1;flex:1
}
.items__item--title{color:#111;font-weight:bold
}
.items__item--star{display:block;width:100px;height:100px;line-height:100px;text-align:center;font-size:16px
}
.items__item--star i{font-size:22px;color:#ffde0d;margin-left:10px
}
.items__item--img{width:100px;display:-webkit-box;display:-ms-flexbox;display:flex;-webkit-box-pack:center;-ms-flex-pack:center;justify-content:center;-webkit-box-align:center;-ms-flex-align:center;align-items:center
}
.items__item--img img{display:block;width:60px
}
