html, body {
  font-size: 13px;
  font-family: -apple-system, PingFang SC, Hiragino Sans GB, Arial, Microsoft YaHei, Helvetica Neue, sans-serif;
  color: #444;
  padding: 0;
  margin: 0;
}

html {
  min-height: 100%;
  background: linear-gradient(
      135deg,
      papayawhip,
      powderblue,
      peachpuff,
      goldenrod
  );
  background-repeat: no-repeat;
}

.page {
  width: 100%;
  height: 100%;
}
.items {
  padding: 0;
  margin: 0;
  display: block;
  &__item {
    box-sizing: border-box;
    width: 100%;
    list-style: none;
    padding: 10px;
    border-bottom: 1px dashed #eee;
    a {
      box-sizing: border-box;
      display: flex;
      text-decoration: none;
      color: #333;
      height: 100px;
      span {
        display: block;
        height: 100px;
        line-height: 100px;
        width: 100px;
        text-align: center;
        font-size: 30px;
      }
    }
    &--desc {
      flex: 1;
    }
    &--title {
      color: #111;
      font-weight: bold;
    }
    &--star {
      display: block;
      width: 100px;
      height: 100px;
      line-height: 100px;
      text-align: center;
      font-size: 16px;
      i {
        font-size: 22px;
        color: #ffde0d;
        margin-left: 10px;
      }
    }
  }

}
